import "./itemsPictures.css";
import {items} from "../data/data";

export function ItemsPicturesBlock (){
    return(
        <div className="searched-items-block__items-picture">
          {items.map((el) => {
            return <a href="#" className="items-picture__element" title="alien ship">
            <img src="../image/alien-ship.png" alt="alien"/>   
          </a>
          })}
        </div>
    );
}
